&lt;p&gt;
Flame resistant TRS soft nylon tubing (Equivalent to UL-94 Standard V-0), is available in 20 and 100 meter rolls. The TRS series is applicable for general air pressure and water in a spark atmosphere such as spot welding. Available colors include black, white, red, blue and green.
